import React, { Component } from "react";
import Navbar from "./components/Navbar";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <h1>Hello World</h1>
      </React.Fragment>
    );
  }
}

export default App;
